INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (173,'017','푸른산에 올라가서 신선을 만나고자 했으나 도리어 형통하게 돌아옴과 같습니다. 만일 남의 도움을 만나게 된다면 후회 할 수가 있습니다. 그러나 무단한 험험을 부리게 된다면 반드시 실패하게 됩니다. 남의 도움을 받으려면 항상 인덕을 닦아야 하니 이는 하루 아침에 이루어짐이 아님을 각득하여야 합니다. 남의 말을 함부로 믿지 마십시오 손재하고 구설수가 뒤따르게 될 것입니다. 험험한 일은 처음부터 성사가 없음인데 어찌 환자만 험험된 일을 고집하여 실패를 자초하려 하십니까. 만일 망령되게 이동하면 후회를 면치 어렵겠습니다. 형은 북방을 침혹하고 동생은 서쪽을 침공함과 같으니 필시 쟁산이 있을 것입니다. 그러나 올바로 살피지 못한다면 신명만 흘비하겠습니다. 모든 일에 해가 있으니 전암을 치른듯 조심해야 합니다.','하는 일에 실패수가 있으니 이를 구하여 꾸해 보지만 이루기가 매우 힘들겠습니다. 살피는 안목이 밝지 못하여 사리를 분간하는 데 무리가 있으니 다만 신명만 흘비합니다. 일을 책망함이 많으니 이루어도 속히 패하게 됩니다.','바다 가운데로 나가서 구실을 찾으니 좋은 보배를 얻기는 매우 어렵습니다. 일이 여의찮 못하니 먼저는 욕더라도 주인은 초푸르게될 것이니 주의하십시오. 친한 사람을 함부로 믿지 마십시오 .재흉이 그로 인하여 생기게 되겠습니다.','문밖에 나가지 못하니 먼저는 원통하여 욕게 되지만 나중엔 그로 인해 올게 되겠습니다. 집에 작은 근심이 있으니 몸과 마음이 편치 못하겠습니다 뜻하지 않은 일로 소설을 맺게 될지 모르니 어떤 시비가 닥쳐도 피해야 합니다.','대인은 길한 여수고 소인은 해가 있으니 심중을 잘 헤아려서 임하여야 합니다. 도처에 재물이 있으니 사람들이 와서 도와주겠습니다. 이렇게 좋은 기회를 앗게 되면 또 만나기가 쉽지 않을 것입니다. 꼭 잡아야 합니다.','집에 있으면 길하고 다른 데로 나가면 해롭습니다. 하던 일을 지키고 새것을 도모하면 이롭지 못합니다. 이사하거나 업을 바꾸면 흉함이 변하여 길함이 될 것이니 나를 돕는 자가 생기는 것을 기다렸다가 실시하십시오. 박손이 도움 것입니다.','적은 것을 버릴 줄 알면 그것으로 인하여 큰 것을 취하게 될 것입니다. 그러나 도리어 그것이 해로우니 어찌하겠습니까. 두 사람의 마음이 각각 낙담게 되겠습니다. 다른 사람과 일을 함께 꾸하게 되면 그 해를 면치 어렵겠습니다.','비록 재물이 생기지만 얻어서 그 잠밖을 앗게 되니 이를 어찌하겠습니까. 성사가 짧기지 않으며 손재수가 뒤 따라 다닙니다. 가까이 있는 것을 엿보고 버리게 되면 비록 먼 것을 꾸하더라도 성공하지 못하고 실패하기 쉬운 것입니다.','덕을 쌓아서 금을 얻는 격이니 반드시 재물을 얻어 기쁨을 맛보겠습니다. 슬지어는 다른 사람에게 돌아간 재물도 내게로 돌아오니 이 무슨 후회란 말입니까. 이름이 나고 건강이 좋아지니 그 가운데서 재물까지 얻게 됩니다.','초목이 가을을 맞았으니 마음에 번민이 많습니다. 만약 이사하거나 다른 것을 도모하여 실행하면 길할 것이니 각행하십시오. 그러나 신원이 불리하니 가정에 우환이 있거나 복을 앗게 될 것입니다. 이 또한 여수 입니다.','두 사람의 마음이 같으니 일을 구함에 가히 뜻을 이룰 수 있을 것입니다. 사람을 잘 못 사귐으로 해서 도리어 해를 입게 될 것이니 사람을 조심하십시오. 그러나 사람으로 인해 놀토를 늘리고 가업이 성할 것이니 어찌 사귀기를 멈추겠습니까?','의수가 불길하니 다른 일을 경영하지 마십시오. 남의 말을 믿게 되면 그로 인해 낭패가 있을 것입니다. 남의 꾸임에 넘어가 일을 도모하지 않도록 주의하십시오. 백가지 일마다 문제이 많으니 집에 있어 옛것을 지킴이 상책일 것입니다.','비록 재물을 얻기는 하지만 모으기가 어려우니 이를 어찌하겠습니까. 남방에 그 사람이 우연히 도와 줄 것이니 하던 일에 더욱 박차를 가하면 성사될 것입니다. 집에 있어 마음을 지키면 길하고 문을 나가 돈 것을 취하면 흉하겠습니다.','2025-03-02 03:02:01.01002+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (386,'017','我试图去山。如果您遇到别人的帮助，您会后悔。但是，如果您有未经授权的经验，那么您肯定会失败。为了获得别人的帮助，您必须始终擦拭缩进，这不是在早上做的。不要相信别人的话。艰苦的工作是从一开始就没有圣礼。如果您移动它，您将很难后悔。我的兄弟就像北部的颠簸，我的兄弟就像对西方的入侵。但是，如果您看上去不正确，我只会令人兴奋。一切都会造成伤害，所以要小心，好像您已经完成了全本。','您可能无法做到这一点，因此很难获得它。看它并不明亮，因此很难分割纱丽。有很多谴责，因此，即使您这样做，您也会很快被击败。','很难获得良好的宝藏，因为您在海中间出去。工作不好，所以即使您发誓，所有者也会窒息。不要相信亲密的人，并且会创造乳房。','你不能走出门，所以你会圆柱和发誓，但是后来你会来的。家里有很小的焦虑，因此身心不舒服。','成年人有一个长长的Yeosu和一个孩子，因此他们必须能够很好地计算自己的心。到处都有财富，所以人们会来并提供帮助。如果您有一个很好的机会，那么再次见面就不容易了。你必须抓住它。','如果您在家，外出是漫长而有害的。如果您保留自己在做的事情并推广新事物，那将不会受益。如果您移动或改变业力，丑陋将会改变并成为一种方式。公园儿子会帮助。','如果您知道如何将其扔掉，您将付出一件大事。但是您做什么是因为有害？两者的心会灰心。如果您与他人合作，那么一年将很难。','即使我们有财富，我们也摆脱了睡眠。圣礼不短，遵循敏捷。如果您瞥见您附近的事物，即使您做了一些事情，也很容易失败和失败。','这是一个积累美德并获得黄金的废墟。有什么后悔的遗憾是因为返回其他人的财富？这个名字是制作的，您的健康状况更好，因此您将在中间获得财富。','由于植被在秋天，我心中有很多麻烦。如果您移动或运行其他东西，那将是很长的。但是，身份不利，因此在家中会有权利或祝福。这也是Yeosu。','两者的心是相同的，因此您可以实现他们的意志。要小心别人，因为他们将无法使人们变得良好。但是，我们如何停止约会，因为人们会增加人数并从事家族企业？','不要管理其他事情，因为起诉是不祥的。如果您相信别人的话，那将会感到沮丧。请注意，不要能够责骂他人。每百天有很多问题，所以您会在家。','尽管很难收集，但即使我获得了财富，我该怎么办？如果该人会在南方偶然帮助您，那么如果您加速工作，它将成功。如果您在家中保持理智，那么您会很长，如果您离开门，您会很丑陋。','2025-03-02 03:02:01.01002+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (457,'017','私は山に上がろうとしました。あなたが他の人の助けに会ったら、あなたはそれを後悔することができます。しかし、あなたが許可されていない経験を持っているなら、あなたは確かに失敗するでしょう。他の人の助けを得るためには、朝に行われないインデンティブを常に拭く必要があります。他人の言葉を信じないでください。大変な仕事は、最初から秘跡がないということです。あなたがそれを動かすなら、あなたはそれを後悔するのが難しいでしょう。私の兄弟は北の隆起のようで、私の兄弟は西への侵略のようです。しかし、あなたが正しく見えることができないなら、私はエキサイティングになるだけです。すべてに害があるので、Jeonamをやったかのように注意してください。','あなたはそれをしないかもしれないので、それを手に入れるのは難しいです。それを見るのは明るくないので、サリーを分割することは困難です。多くのre責があるので、たとえあなたがそれをしたとしても、あなたはすぐに敗北します。','あなたが海の真ん中に出かけるので、良い宝物を得ることは非常に困難です。仕事は良くないので、たとえあなたが誓ったとしても、所有者は窒息するでしょう。近くの人々を信じないでください、そうすれば胸が作られます。','あなたはドアから出ることができないので、あなたは円筒形で誓いますが、後で来るでしょう。家には小さな不安があるので、体と心は快適ではありません。','大人は長いヨーシュと子供を持っているので、彼らは彼らの心をうまく数えることができなければなりません。どこにでも富があるので、人々は来て助けます。このような良い機会があれば、再び会うのは簡単ではありません。あなたはそれを捕まえなければなりません。','あなたが家にいるなら、外出するのは長くて有害です。あなたがしていることを維持し、新しいことを宣伝すると、それは利益を得ません。カルマを動かしたり変更したりすると、ugさは変わり、道になります。パークの息子が助けます。','あなたがそれを捨てる方法を知っていれば、あなたはそれで大きなことを取ります。しかし、それは有害だからどうしますか？二人の心は落胆します。他の人と一緒に仕事をするなら、それは一年で難しいでしょう。','私たちには富がありますが、私たちは眠りから抜け出します。秘跡は短くなく、器用さが続きます。あなたがあなたの近くにいるものを垣間見るなら、たとえあなたが遠くに何かをしても、それは簡単に失敗して失敗することができます。','美徳を蓄積し、金を獲得するのは破滅です。他の人に戻った富が後悔しているのは何ですか？名前が作成され、あなたの健康はより良いので、あなたは真ん中に富を得るでしょう。','植生は秋にあるので、私は心に多くの問題を抱えています。他の何かを動かしたり実行したりすると、長くなります。しかし、アイデンティティは不利なので、家には正しいことや祝福があります。これもYeosuです。','二人の心は同じなので、あなたは彼らの意志を達成することができます。人々は人々をうまく作ることができないので、人々に注意してください。しかし、人々は人々の数を増やし、家族経営を作るので、どのようにしてデートを止めることができますか？','検察は不吉であるため、他のことを管理しないでください。他人の言葉を信じれば、欲求不満があります。他人のscりに取り組むことができないように注意してください。 100日ごとに多くの問題があるので、あなたは家にいるでしょう。','収集することは困難ですが、豊かになったとしても、私は何ができますか？その人が偶然南であなたを助けるなら、あなたが仕事を加速すればそれは成功するでしょう。あなたが家で心を維持するなら、あなたは長くなり、あなたがドアを離れると醜くなります。','2025-03-02 03:02:01.01002+00','j');
